import React, { Component } from 'react';
import sky from './../imgs/background/01_Sky.svg';
import ground from './../imgs/background/02_Ground.svg';
import sea from './../imgs/background/03_Sea.svg';
import sun from './../imgs/background/04_a_Sun.svg';
import cloud from './../imgs/background/04_b_Cloud.svg';
import './../assets/css/App.css';

class Background extends Component {
  render() {
    return (
      <div>
        <img src={sky}/>
        <img src={ground}/>
        <img src={sea}/>
        <img src={sun}/>
        <img src={cloud}/>
      </div>

    );
  }
}

export default Background;
